angular.module('angularTable').run(['$templateCache', function($templateCache) {$templateCache.put('table.html','<div class="table-container">\n  <div class="table" ng-hide="tableC.errorTable || tableC.errorBrand">\n      <div class="thead">\n          <div class="tr">\n              <div ng-repeat="item in tableC.tableData.thLabel" ng-style="{width: tableC.widthTableCell[$index] + \'%\'}" class="th">\n                  <span>{{item}}</span>\n              </div>\n          </div>\n      </div>\n      <div class="wrap" ng-class="{\'wrap-report\': tableC.report}">\n          <div class="tbody">\n              <div class="tr" ng-repeat="row in tableC.tableData.tdData">\n                  <div ng-repeat="item in row track by $index" ng-style="{width: tableC.widthTableCell[$index] + \'%\'}" class="td">\n                      <p>{{item}}</p>\n                  </div>\n              </div>\n          </div>\n      </div>\n  </div>\n</div>\n');}]);